After an *OVERWHELMING* amount of you let me know via DM and in the comments on my last home tour video that I should have listened to my wife on the speed/art direction of future videos, I heard ALL of you VERY loud and clear 👋🏼😂😂😂. Slowing down the pace from now on!! 

Built in 1922, I really loved how cozy and homey this one felt. And considering it’s up in the hills, the amount of flat outdoor space on the property was honestly mind-blowing. The tiered backyard was essentially a park (Arlo was so pissed when he saw that in-ground trampoline and realized I went without him. Such is life, kid). With that said, please sit back and enjoy 2301 Hollyridge! 🏡🌳🤌🏼 #jminteriorspaces 

